import React from 'react';
import styled from 'styled-components';
import {setFlex, elevation, demotion } from '../../utilities';

const SlideThree = ({className}) => {
  return (
    <div className={className}>
      <h3>SLIDE 3</h3>
    </div>
  );
}

const SThree = styled(SlideThree)`
background-image: linear-gradient(to right,#504A9E, #D68FCE);
  ${setFlex()};
  color: white;
  width: 98%;
  height: 65vh;
  font-size: 4rem;
  margin: 1rem auto;
  border-radius: .7rem;
  ${elevation[5]}
`;

export default SThree;
